package testcase.algorithms.A0389_FindTheDifference;

import problems.algorithms.A0389_FindTheDifference.Solution;

/**
 * A0389_FindTheDifference
 *
 * @author ml3426
 * @date 2020/12/18
 */
public class TestCase {

    public static void main(String[] args) {
        test("abcd", "abcde", 'e');
        test("", "y", 'y');
        test("a", "aa", 'a');
        test("ae", "aea", 'a');
        test("",
                "", 't');
    }

    public static void test(String s, String t, char expectedResult) {
        final char actualValue = new Solution().findTheDifference3(s, t);
        System.out.println(String.format("param1 is %s, param2 is %s, ", s, t) +
                (actualValue == expectedResult ? String.format("result is %s, correct!", actualValue) :
                        String.format("expectedResult is %s, actualValue is %s, failed", expectedResult, actualValue)));
    }
}
